	void int2_HEX(uint32_t yo)
{
	long quotient,remainder;
	quotient = yo;

	for(int h=0;h<6;h++)
    {
        remainder = quotient % 16;
        
				temp_hex[h] = remainder;
								
        quotient = quotient / 16;
    }
		tempin_hex[0]=(temp_hex[5]<<4)+temp_hex[4];
		tempin_hex[1]=(temp_hex[3]<<4)+temp_hex[2];
		tempin_hex[2]=(temp_hex[1]<<4)+temp_hex[0];
}

	
	
	void beacon_checksum()
{
	int2_HEX((adc_res_cha_4*10));
	
	arrayforchecksum[0] = tempin_hex[0];
	arrayforchecksum[1] = tempin_hex[1];
	arrayforchecksum[2] = tempin_hex[2];
	
	int2_HEX((adc_res_cha_7*10));
	
	arrayforchecksum[3] = tempin_hex[0];
	arrayforchecksum[4] = tempin_hex[1];
	arrayforchecksum[5] = tempin_hex[2];
	
	arrayforchecksum[6] = Batterysense;
	
	arrayforchecksum[7] = Contactsense;
	
	arrayforchecksum[8] = 0x00;
	arrayforchecksum[9] = 0x00;
	
	
	beaconchecksum = arrayforchecksum[0]+arrayforchecksum[1]+arrayforchecksum[2]+arrayforchecksum[3]+arrayforchecksum[4]+arrayforchecksum[5]+arrayforchecksum[6]+arrayforchecksum[7]+arrayforchecksum[8]+arrayforchecksum[9];
	
}


void hexseparation(uint8_t hex)
{
	uint8_t MSB_hex, LSB_hex,value_beacon;
	
	value_beacon = hex;
	
	MSB_hex=value_beacon>>4;
	LSB_hex=value_beacon&0x0F;
		if (MSB_hex < 10)
		{
				a2d_string[0] = 48 + MSB_hex;
		}
    else
		{
				a2d_string[0] = 55 + MSB_hex;
		}
		
		if (LSB_hex < 10)
		{
				a2d_string[1] = 48 + LSB_hex;
		}
    else
		{
				a2d_string[1] = 55 + LSB_hex;
		}
	
	
}


	
