void Set_TimeDate(void)
{
	int i = 0;
	RTC_TimeTypeDef vTime;
	RTC_DateTypeDef vDate;
	
	while(ble_pre_config[i] != '$')
	{
		if(ble_pre_config[i] == '*' && ble_pre_config[i+1] == '6' && ble_pre_config[i+2] == '1')
		{
			HAL_RTC_GetTime(&hrtc,&vTime,RTC_FORMAT_BCD);
			HAL_RTC_GetDate(&hrtc,&vDate,RTC_FORMAT_BCD);
			
			ble_pre_config[i+4] = (((vTime.Hours)>>4) + 0x30);
			ble_pre_config[i+5] = (((vTime.Hours) & 0x0F)+ 0x30);
			ble_pre_config[i+6] = (((vTime.Minutes)>>4)+ 0x30);
			ble_pre_config[i+7] = (((vTime.Minutes) & 0x0F)+ 0x30);
			ble_pre_config[i+8] = (((vTime.Seconds)>>4)+ 0x30);
			ble_pre_config[i+9] = (((vTime.Seconds) & 0x0F)+ 0x30);
		}
		i++;
	}
	
	
	
	uint32_t checksum = 0;
	for(int j=0;ble_pre_config[j] != '$';j++)
	{
		checksum = checksum + (ble_pre_config[j] - 48); 
	}
	ble_pre_config[i+1] = (uint8_t)checksum;
	
	
}



void writeDataFlash(uint8_t *FlashData)
{
	
	HAL_FLASH_Unlock();
	
	dataCnt =0;

	Fetch_Flag();
	PgCount = Flash_Flag_ary[2];
	
	Page_Start_Addr = ADDR_FLASH_PAGE_140 + (PgCount * 2048);
	Next_Page_Start_Addr = Page_Start_Addr + 2048;

							while(Page_Start_Addr != Next_Page_Start_Addr)
							{	
									dataCnt++;
								 if((*(uint8_t*)(Page_Start_Addr)) == 0xFF)
								 {
									
									 if (dataCnt <= 256)
									 {
											HAL_FLASH_Program(FLASH_TYPEPROGRAM_DOUBLEWORD, (Page_Start_Addr), *(uint64_t*)(FlashData));
											HAL_Delay(5);
											goto K1;
									 }	
															 
 								 } 
								 	Page_Start_Addr = Page_Start_Addr+8;	
							 }
							
							 K1:
							 
							if(dataCnt==256)
							{
								PgCount++;
								Fetch_Flag();
									Flash_Flag_ary[2] = PgCount;
							Write_Flag();
								if(PgCount == 28)
								{
									PgCount = 0;
									Flash_erase_page_flag=1;
								Flash_Erase_Pageaddress = ADDR_FLASH_PAGE_140;
									
									//FLASH_ERASE_PAGE(ADDR_FLASH_PAGE_140);
								}
								else if(PgCount < 28)
								{
									Flash_erase_page_flag=1;
								Flash_Erase_Pageaddress = Next_Page_Start_Addr;
									
							//		FLASH_ERASE_PAGE(Next_Page_Start_Addr);
								}											
							
								
							}
				
							 

			HAL_FLASH_Lock();
	
}



