void Write_Ble_Preconfig(void)
{
	uint8_t j=1,page2_flag=0;
	
	counter1_mem=0; 
	counter2_mem=0;
	
	uint32_t WRITE_BLEPRECONFIG = FLASHPAGE_128;
	uint32_t WRITE_BLEPRECONFIG1 = FLASHPAGE_129;
	

	
	HAL_FLASH_Unlock();
	
			while(WRITE_BLEPRECONFIG != FLASHPAGE_130)
			{
				counter1_mem++;
				if((*(uint8_t*)(WRITE_BLEPRECONFIG)) !=0x2A)
				{
						goto L1;	
				}
				
				WRITE_BLEPRECONFIG = WRITE_BLEPRECONFIG +128;
			}
			
			L1:
			
			if(counter1_mem ==1||counter1_mem>16)
			{
				for(int j=0;j<17;j++)
				{
					counter2_mem++;
					if(((*(uint8_t*)(WRITE_BLEPRECONFIG1)) !=0x2A) && counter2_mem!=17)
					{
						goto L2;
					}
					WRITE_BLEPRECONFIG1 = WRITE_BLEPRECONFIG1 +128;
				}
			}
			
			L2:
			
			if(counter1_mem ==1 && counter2_mem ==1)
			{
				WRITE_BLEPRECONFIG = FLASHPAGE_128;
					for(int i=0;i<112;i+=8)
					{
					HAL_FLASH_Program(FLASH_TYPEPROGRAM_DOUBLEWORD, (WRITE_BLEPRECONFIG), *(uint64_t*)(ble_pre_config+i));
					HAL_Delay(5);
					WRITE_BLEPRECONFIG  = WRITE_BLEPRECONFIG + 8;
					}
					
			}
			
			else if(counter1_mem >16 && counter2_mem ==1)
			{
				WRITE_BLEPRECONFIG = FLASHPAGE_129;
					for(int i=0;i<112;i+=8)
					{
					HAL_FLASH_Program(FLASH_TYPEPROGRAM_DOUBLEWORD, (WRITE_BLEPRECONFIG), *(uint64_t*)(ble_pre_config+i));
					HAL_Delay(5);
					WRITE_BLEPRECONFIG  = WRITE_BLEPRECONFIG + 8;
					}
					
			}
			
			else if(counter1_mem ==1 && counter2_mem >1 && counter2_mem<17)
			{
				WRITE_BLEPRECONFIG = FLASHPAGE_129+((counter2_mem-1)*128);
					for(int i=0;i<112;i+=8)
					{
					HAL_FLASH_Program(FLASH_TYPEPROGRAM_DOUBLEWORD, (WRITE_BLEPRECONFIG), *(uint64_t*)(ble_pre_config+i));
					HAL_Delay(5);
					WRITE_BLEPRECONFIG  = WRITE_BLEPRECONFIG + 8;
					}
					
			}
			
			else if(counter1_mem ==1 && counter2_mem ==17)
			{
				WRITE_BLEPRECONFIG = FLASHPAGE_128;
					for(int i=0;i<112;i+=8)
					{
					HAL_FLASH_Program(FLASH_TYPEPROGRAM_DOUBLEWORD, (WRITE_BLEPRECONFIG), *(uint64_t*)(ble_pre_config+i));
					HAL_Delay(5);
					WRITE_BLEPRECONFIG  = WRITE_BLEPRECONFIG + 8;
					}
					
			}
			
		
			else
			{
				
				WRITE_BLEPRECONFIG = FLASHPAGE_128+((counter1_mem-1)*128);
				for(int i=0;i<112;i+=8)
					{
					HAL_FLASH_Program(FLASH_TYPEPROGRAM_DOUBLEWORD, (WRITE_BLEPRECONFIG), *(uint64_t*)(ble_pre_config+i));
					HAL_Delay(5);
					WRITE_BLEPRECONFIG  = WRITE_BLEPRECONFIG + 8;
					}
				
			}
					
					if(counter1_mem>16 )
					{
						Flash_erase_page_flag=1;
						Flash_Erase_Pageaddress = FLASHPAGE_128;
					//	FLASH_ERASE_PAGE(FLASHPAGE_128);
					}
					
					if(counter2_mem>16)
					{
						Flash_erase_page_flag=1;
						Flash_Erase_Pageaddress = FLASHPAGE_129;
			//			FLASH_ERASE_PAGE(FLASHPAGE_129);
					}
			
			HAL_FLASH_Lock();
}


