void Write_Flag(void)
{
	uint8_t j=1;

	Flag_counter1=0; 
	Flag_counter2=0;
	
	uint32_t WRITE_FLAGCONFIG = FLASHPAGE_130;
	uint32_t WRITE_FLAGCONFIG1 = FLASHPAGE_131;
	
	HAL_FLASH_Unlock();
	
			while(WRITE_FLAGCONFIG != 0x08042000)
			{
				Flag_counter1++;
				if((*(uint8_t*)(WRITE_FLAGCONFIG)) !=0xAA)
				{
						goto L1;	
				}
				
				WRITE_FLAGCONFIG = WRITE_FLAGCONFIG + 8;
			}
			
			L1:
			
			if(Flag_counter1 ==1||Flag_counter1 > 256)
			{
				for(int j=0; j<257; j++)
				{
					Flag_counter2++;
					if(((*(uint8_t*)(WRITE_FLAGCONFIG1)) != 0xAA ) && Flag_counter2 != 257)
					{
						goto L2;
					}
					WRITE_FLAGCONFIG1 = WRITE_FLAGCONFIG1 + 8;
				}
			}
			
			L2:
			
			if(Flag_counter1 ==1 && Flag_counter2 ==1)
			{
				WRITE_FLAGCONFIG = FLASHPAGE_130;
					for(int i=0;i<8;i+=8)
					{
						HAL_Delay(5);
					HAL_FLASH_Program(FLASH_TYPEPROGRAM_DOUBLEWORD, (WRITE_FLAGCONFIG), *(uint64_t*)(Flash_Flag_ary+i));
					HAL_Delay(5);
					WRITE_FLAGCONFIG  = WRITE_FLAGCONFIG + 8;
					}
					
			}
			
			else if(Flag_counter1 > 256 && Flag_counter2 ==1)
			{
				WRITE_FLAGCONFIG = FLASHPAGE_131;
					for(int i=0;i<8;i+=8)
					{
						HAL_Delay(5);
					HAL_FLASH_Program(FLASH_TYPEPROGRAM_DOUBLEWORD, (WRITE_FLAGCONFIG), *(uint64_t*)(Flash_Flag_ary+i));
					HAL_Delay(5);
					WRITE_FLAGCONFIG  = WRITE_FLAGCONFIG + 8;
					}
					
			}
			
			else if(Flag_counter1 ==1 && Flag_counter2 >1 && Flag_counter2<257)
			{
				WRITE_FLAGCONFIG = FLASHPAGE_131+((Flag_counter2-1)*8);
					for(int i=0;i<8;i+=8)
					{
						HAL_Delay(5);
					HAL_FLASH_Program(FLASH_TYPEPROGRAM_DOUBLEWORD, (WRITE_FLAGCONFIG), *(uint64_t*)(Flash_Flag_ary+i));
					HAL_Delay(5);
					WRITE_FLAGCONFIG  = WRITE_FLAGCONFIG + 8;
					}
					
			}
			
			else if(Flag_counter1 ==1 && Flag_counter2 == 257)
			{
				WRITE_FLAGCONFIG = FLASHPAGE_130;
					for(int i=0;i<8;i+=8)
					{
						HAL_Delay(5);
					HAL_FLASH_Program(FLASH_TYPEPROGRAM_DOUBLEWORD, (WRITE_FLAGCONFIG), *(uint64_t*)(Flash_Flag_ary+i));
					HAL_Delay(5);
					WRITE_FLAGCONFIG  = WRITE_FLAGCONFIG + 8;
					}
					
			}
			
		
			else
			{
				
				WRITE_FLAGCONFIG = FLASHPAGE_130+((Flag_counter1-1)*8);
				for(int i=0;i<8;i+=8)
					{
						HAL_Delay(5);
					HAL_FLASH_Program(FLASH_TYPEPROGRAM_DOUBLEWORD, (WRITE_FLAGCONFIG), *(uint64_t*)(Flash_Flag_ary+i));
					HAL_Delay(5);
					WRITE_FLAGCONFIG  = WRITE_FLAGCONFIG + 8;
					}
				
			}
					
					if(Flag_counter1>256 )
					{
						Flash_erase_page_flag=1;
						Flash_Erase_Pageaddress = FLASHPAGE_130;
					//	FLASH_ERASE_PAGE(FLASHPAGE_130);
					}
					
					if(Flag_counter2>256)
					{
						Flash_erase_page_flag=1;
						Flash_Erase_Pageaddress = FLASHPAGE_131;
					
					//	FLASH_ERASE_PAGE(FLASHPAGE_131);
					}
			
			HAL_FLASH_Lock();
}



static uint32_t GetPage(uint32_t Addr)
{
  uint32_t page = 0;
  
  if (Addr < (FLASH_BASE + FLASH_BANK_SIZE))
  {
    /* Bank 1 */
    page = (Addr - FLASH_BASE) / FLASH_PAGE_SIZE;
  }
  else
  {
    /* Bank 2 */
    page = (Addr - (FLASH_BASE + FLASH_BANK_SIZE)) / FLASH_PAGE_SIZE;
  }
  
  return page;
}

static uint32_t GetBank(uint32_t Addr)
{
  uint32_t bank = 0;
  
  if (READ_BIT(SYSCFG->MEMRMP, SYSCFG_MEMRMP_FB_MODE) == 0)
  {
  	/* No Bank swap */
    if (Addr < (FLASH_BASE + FLASH_BANK_SIZE))
    {
      bank = FLASH_BANK_1;
    }
    else
    {
      bank = FLASH_BANK_2;
    }
  }
  else
  {
  	/* Bank swap */
    if (Addr < (FLASH_BASE + FLASH_BANK_SIZE))
    {
      bank = FLASH_BANK_2;
    }
    else
    {
      bank = FLASH_BANK_1;
    }
  }
  
  return bank;
}


