//=========================------------------------------------------------>>MIP COMMAND UPDATE
void mip_command_update(uint8_t array)
{
	 uint8_t temp;
	 uint8_t i;
//--------------------------------------------------------------------------------//
	
	 SDA_LOW;         //       /```````\_______________________ DATA LOW
   SCLK_LOW;        //       /```````\_______________________ CLK LOW

//--------------------------------------------------------------------------------//	
	
	temp = 0;
	temp = array;
//--------------------------------------------------------------------------------//	
  //================----------------------------->>LSB FIRST SEND 	
	
	for(i = 0;i < 6;i++)
  {
		if((temp&0x01) == 1)
		{
		  SDA_HIGH;     //      _______________________/```````\ DATA HIGH
		}
		else//if((temp&0x01) == 0)
		{
		  SDA_LOW;     //      /```````\_______________________ DATA LOW
		}

		SCLK_HIGH;     //      _______________________/```````\ CLK HIGH 
		SCLK_LOW;      //      /```````\_______________________ CLK LOW

		temp >>= 1;

	}
	EXTICMONIN_HIGH;
	__NOP;
	__NOP;
	__NOP;
	__NOP;
	__NOP;
	EXTICMONIN_LOW;
//--------------------------------------------------------------------------------//
	//====END====//
}



//=========================------------------------------------------------>>MIP GATE ADDRESS
void mip_gate_address(uint16_t row)
{
   uint16_t temp;
	 uint8_t i;
//--------------------------------------------------------------------------------//
	
	 SDA_LOW;         //      /```````\_______________________ DATA LOW
   SCLK_LOW;        //      /```````\_______________________ CLK LOW

//--------------------------------------------------------------------------------//	
	
	temp = 0;
	temp = row;
	
//--------------------------------------------------------------------------------//	
	 //================----------------------------->>MSB FIRST SEND
	
	for(i = 0;i < 10;i++)
  {
		if(((temp&0x200)>>9) == 1)
  	{
		  SDA_HIGH;     //      _______________________/```````\ DATA HIGH
		}
		else
		{
		  SDA_LOW;     //      /```````\_______________________ DATA LOW
		}

		SCLK_HIGH;     //      _______________________/```````\ CLK HIGH
		SCLK_LOW;      //      /```````\_______________________ CLK LOW

		temp <<= 1;

	}
	 
//--------------------------------------------------------------------------------//
	//====END====//
}

//=========================------------------------------------------------>>MIP DATA DISPLAY VALUE
void mip_data(uint8_t data)
{
  uint8_t temp;
	uint8_t i;
//--------------------------------------------------------------------------------//
	
	 SDA_LOW;         //      /```````\_______________________ DATA LOW
   SCLK_LOW;        //      /```````\_______________________ CLK LOW

//--------------------------------------------------------------------------------//	
	
	temp = 0;
	temp = data;
	
//--------------------------------------------------------------------------------//	
	//================----------------------------->>LSB FIRST SEND
	
	for(i = 0;i < 8;i++)
  {
		
		if((temp&0x80) == 0x80)
		{
		  //SDA_HIGH;     //      _______________________/```````\ DATA HIGH
			SDA_LOW;
		}
		else
		{
		  //SDA_LOW;     //      /```````\_______________________ DATA LOW
			SDA_HIGH;
		}

		SCLK_HIGH;     //      _______________________/```````\ CLK HIGH
		SCLK_LOW;      //      /```````\_______________________ CLK LOW

		temp <<= 1;
		
	}
	 
//--------------------------------------------------------------------------------//
	//====END====//

}



//=========================------------------------------------------------>>MIP DUMMY DATA VALUE
void mip_dummy_data(uint8_t data)
{
	 uint8_t i;
//--------------------------------------------------------------------------------//
	
	 SDA_LOW;         //      /```````\_______________________ DATA LOW
   SCLK_LOW;        //      /```````\_______________________ CLK LOW
	
	for(i = 0;i < data;i++)
  {
		SCLK_HIGH;     //      _______________________/```````\ CLK HIGH 
		SCLK_LOW;      //      /```````\_______________________ CLK LOW
	}
	 
//--------------------------------------------------------------------------------//
	//====END====//

}

//=========================------------------------------------------------>>MIP DATA TRANSFER VALUE
void mip_data_trans()
{
  int count,count2,address;
	mip_command_update(MODE);
	for(count = 0;count < 240;count++)
	{
	  mip_gate_address(count);
		for(count2 = 0;count2 < 50;count2++)
		{
		  address = ((count*50) + count2);
			mip_data(Mono_1BPP[address]);	
		}
		mip_dummy_data(6);
 	}
	mip_dummy_data(16);
}



void mip_data_tran(const uint8_t *s)
{
  int count,count2,address;
	mip_command_update(MODE);
	for(count = 0;count < 240;count++)
	{
	  mip_gate_address(count);
		for(count2 = 0;count2 < 50;count2++)
		{
		  address = ((count*50) + count2);
			mip_data(s[address]);	
		}
		mip_dummy_data(6);
 	}
	mip_dummy_data(16);
}
