//=========================------------------------------------------------>>BATTERY LEVEL AVG & 
double battery_level(void)
{
  uint8_t i;
	adc_average = 0;

	//Averaging the ADC value
	for(i=0;i<sample_number;i++)
	{
		adc_average = adc_average + adcval[1][i];
	}
	adc_average = adc_average/sample_number;
	
	
	//Optimising the error
	//We will not do anything to error if its 4095 as that's true
	if(adc_average >= 4094)
	{
	}
	else
	{
		adc_average = adc_average - adc_error_cha_1;
	}
	
	//Finding the voltage from ADC average
	adc_volt_cha_1 = adc_average/max_adc;
	adc_volt_cha_1 = adc_volt_cha_1*ref_voltage;
	//Multiplying it by 2 as both R1 and R2 in battery level are equal if changed than do accordingly
	adc_volt_cha_1 = adc_volt_cha_1*2.0;
	
	return adc_volt_cha_1;
	
}
