double read_adc_resistance_4(void)
{
	uint8_t i;
	adc_average = 0;
	
	//Averaging the ADC value
	for(i=0;i<sample_number;i++)
	{
		adc_average = adc_average + adcval[adc_val_location_1][i];
	}

	adc_average = adc_average/sample_number;
	
	
	
	//Optimising the error
	//We will not do anything to error if its 4095 as that's true
	if(adc_average >= 4094)
	{
	}
	else
	{
		//Finding resistance value of sensor
	if (sensor_selection_flag == 0)
	{
		adc_error_cha_4 = ADC_CH4_OFFSET_10K;																					//for particular board - E28B
		adc_average = adc_average - adc_error_cha_4;
		
		adc_res_cha_4 = bal_res_10k * ( (max_adc / adc_average) - 1);
	}
	else if (sensor_selection_flag == 1)
	{
		adc_error_cha_4 = ADC_CH4_OFFSET_100K;
		
		if(adc_average<500)
		{
			Ex_adc_error_cha_4 = ADC_CH4_OFFSET_100K_40;
		}
		
		else if(adc_average>500 && adc_average<1000)
		{
			Ex_adc_error_cha_4 = ADC_CH4_OFFSET_100K_20;
		}
		
		else if(adc_average>1000 && adc_average<2100)
		{
			Ex_adc_error_cha_4 = ADC_CH4_OFFSET_100K_0;
		}
		
		else if(adc_average>3000 && adc_average<4095)
		{
			Ex_adc_error_cha_4 = ADC_CH4_OFFSET_100K_60;
		}


		adc_average = adc_average - adc_error_cha_4 - Ex_adc_error_cha_4;
		adc_res_cha_4 = bal_res_100k * ( (max_adc / adc_average) - 1);
	}
	//Finding the voltage from ADC average
	adc_volt_cha_4 = adc_average/max_adc;
	adc_volt_cha_4 = adc_volt_cha_4*ref_voltage;
	}
	
	
	
	return adc_res_cha_4;
}



