void reset_datetime()
{
	
	RTC_TimeTypeDef vTime;
	RTC_DateTypeDef vDate;
	
	
	HAL_RTC_GetTime(&hrtc,&vTime,RTC_FORMAT_BCD);
	HAL_RTC_GetDate(&hrtc,&vDate,RTC_FORMAT_BCD);
	
	reset_year = vDate.Year;
	reset_month = vDate.Month;
	reset_date = vDate.Date;
	reset_hour = vTime.Hours;
	reset_min = vTime.Minutes;
	
	
	
	datetime[0] = ((reset_year & 0xF000)>>12)+48;
	datetime[1] =((reset_year & 0x0F00)>>8)+48;
	datetime[2] =((reset_year & 0x00F0)>>4)+48;
	datetime[3] =((reset_year & 0x000F))+48;
	
	datetime[4] =((reset_month & 0x00F0)>>4)+48;
	datetime[5] =((reset_month & 0x000F))+48;
	
	datetime[6] =((reset_date & 0x00F0)>>4)+48;
	datetime[7] =((reset_date & 0x000F))+48;
	
	datetime[8] =((reset_hour & 0x00F0)>>4)+48;
	datetime[9] =((reset_hour & 0x000F))+48;
	
	datetime[10] =((reset_min & 0x00F0)>>4)+48;
	datetime[11] =((reset_min & 0x000F))+48;
	

		
}

