//=========================------------------------------------------------>>Converting resistance of sensor into a2d value to be sent
double resis2a2d(double yo)
{
		double vout;
	  vout = (30000/(yo+30000));
		vout = vout*2.7;

		//Now we will convert vout to a2d value

		vout = vout*97090;

		return vout;
}
//=========================------------------------------------------------>>Converting resistance of sensor into a2d value to be sent
double humi2a2d(double yo)
{
	uint8_t i;
	for(i=0;i<128;i++)
  {
    if(yo<=temp_f[i])
    {
      lower_index = i-1;
      higher_index = i;
      break;
    }
  }

  //We will find the difference of those upper and lower value of a2d array and temp_f array and then find our temp from that    
  diff_a2d = a2d_10k[higher_index] - a2d_10k[lower_index];
  diff_humi = temp_f[higher_index] - temp_f[lower_index];

  //dividing both the ratios will give us number of count increment needed for 1 degree change in temperature so we will again divide it by 10
  //so that it will give us number of increment needed for giving 0.1 degree change in temperature.
  ratio = diff_a2d/(diff_humi*10);

  //We will now find difference between  our humidity and lower humidity
  diff_humi = yo-temp_f[lower_index];
  diff_humi = diff_humi*10;

  diff_a2d = ratio*diff_humi;
  a2d_humi = a2d_10k[lower_index] + diff_a2d;
	
	return a2d_humi;
}
//=========================------------------------------------------------>>converting voltage values to temp value
double a2d2temp(double yo)
{
	uint8_t i;
	//Finding the upper and lower index value inbetween which our a2d value exist.
  if (sensor_selection_flag == 0)
	{
  for(i=0;i<128;i++)
  {
    if(yo<=a2d_10k[i])
    {
      lower_index = i-1;
      higher_index = i;
      break;
    }
  }


  //We will find the difference of those upper and lower value of a2d array and temp_f array and then find our temp from that    
  diff_a2d = a2d_10k[higher_index] - a2d_10k[lower_index];
  diff_temp = temp_f[higher_index] - temp_f[lower_index];
  

  //dividing both the ratios will give us number of count increment needed for 1 degree change in temperature so we will again divide it by 10
  //so that it will give us number of increment needed for giving 0.1 degree change in temperature.
  ratio = diff_a2d/(diff_temp*10);

  //We will find the difference between lower value of a2d and our value of a2d.
  diff_a2d = yo - a2d_10k[lower_index];
}
	
else if (sensor_selection_flag == 1)
{
	for(i=0;i<128;i++)
  {
    if(yo<=a2d_100k[i])
    {
      lower_index = i-1;
      higher_index = i;
      break;
    }
  }


  //We will find the difference of those upper and lower value of a2d array and temp_f array and then find our temp from that    
  diff_a2d = a2d_100k[higher_index] - a2d_100k[lower_index];
  diff_temp = temp_f[higher_index] - temp_f[lower_index];
  

  //dividing both the ratios will give us number of count increment needed for 1 degree change in temperature so we will again divide it by 10
  //so that it will give us number of increment needed for giving 0.1 degree change in temperature.
  ratio = diff_a2d/(diff_temp*10);

  //We will find the difference between lower value of a2d and our value of a2d.
  diff_a2d = yo - a2d_100k[lower_index];
	

}  


//I will now find the difference to be added in the lower temperature value to find our temp for our a2d count
  delta_temp = diff_a2d/ratio;

  delta_temp = delta_temp*0.1;

  //Adding the difference and getting our final value of temperature.
  temp_a2d = temp_f[lower_index] + delta_temp;
	
	return temp_a2d;
}

//=========================------------------------------------------------>>DOUBLE TO STRING CONVERSTION
void double2string_HEX(double yo)
{
	long quotient,remainder;
	quotient = yo;

	for(string_size=0;quotient != 0;string_size++)
    {
        remainder = quotient % 16;
        if (remainder < 10)
				{
					a2d_string[string_size] = 48 + remainder;
				}
        else
				{
					a2d_string[string_size] = 55 + remainder;
				}
				
        quotient = quotient / 16;
    }
}

