//=========================------------------------------------------------>>GENERATING CRC CODE
uint8_t generate_crc8(const uint8_t *data, int len) 
{
	//I have copied this CRC calculator function from that website https://os.mbed.com/users/andcor02/code/Sht31/
    const uint8_t POLYNOMIAL = 0x31;
    uint8_t crc = 0xFF;
 
    for ( int j = len; j; --j ) 
		{
        crc ^= *data++;
 
        for ( int i = 8; i; --i ) 
				{
            crc = (crc & 0x80) ? (crc << 1) ^ POLYNOMIAL : (crc << 1);
        }
    }
    return crc;
}
//=========================------------------------------------------------>>Function definitions for SHT331-D
void read_sht31()
{
	uint8_t i2cdata[2];
	//First we will check if sensor is present or not at address 0x44. In ARM we have to left shift it by 1 bit compulsory so dont forget that.
	//If the sensor is present then we will measure the temperature and humidity otherwise we will send 0(zero) in both temp and humi
	//I have refered following site for interfacing look into it (codes)  https://os.mbed.com/users/andcor02/code/Sht31/
	if((HAL_I2C_IsDeviceReady(&hi2c1,(0x44 << 1),2,10)) == HAL_OK)
	{
		//After ensuring that it is avaiable we will send measurement command  so that it will give us temp and humi.
		//In datasheer the command mentioned is 0xE0 0x00 but it didn't worked so I tried the command which is given in that site and it worked which is 0x24 0x00
		//After sending the command the sensor will give us 6 bytes of data first 2 byte are temperature (total 16 bit) third byte is CRC8 of temp
		//4th and 5th bytes are humidity and 6th byte is CRC of humidity.
		
			i2cdata[0] = 0x24;
			i2cdata[1] = 0x00;
			
			HAL_I2C_Master_Transmit(&hi2c1,(0x44<<1),i2cdata,2,10);
			//HAL_Delay(10);
			
			//i2cdata_receive[2]
			for(int i = 0;i<6;i++)
			{
				HAL_I2C_Master_Receive(&hi2c1,(0x44<<1),&i2cdata_receive[0],6,10);
				HAL_Delay(10);
			}
				
			//Generating CRC of temp from first 2 bytes
			crc_check = generate_crc8(&i2cdata_receive[0],2);
			
			if(i2cdata_receive[2] != crc_check)
			{
				temp_sht31 = 0;	
			}
			
			else
			{
				temp_raw_sht31 = i2cdata_receive[0];
				temp_raw_sht31 <<= 8;
				temp_raw_sht31 = temp_raw_sht31 | i2cdata_receive[1];	
					
				temp_sht31 = temp_raw_sht31;
				temp_sht31 *= 175;
				temp_sht31 /= 0xffff;
				temp_sht31 = -45 + temp_sht31;
			}
			
			//Generating CRC of humi from first 3rd and 4th bytes
			crc_check = generate_crc8(&i2cdata_receive[3],2);
			
			if(i2cdata_receive[5] != crc_check)
			{
				humi_sht31 = 0;	
			}			
			
			else
			{
				humi_raw_sht31 = i2cdata_receive[3];
				humi_raw_sht31 <<= 8;
				humi_raw_sht31 = humi_raw_sht31 | i2cdata_receive[4];	
			
				humi_sht31 = humi_raw_sht31;
				humi_sht31 *= 100;
				humi_sht31 /= 0xFFFF;
			}
	}
	
	else if((HAL_I2C_IsDeviceReady(&hi2c1,0x40,2,10)) == HAL_OK)
	{
			i2cdata[0] = 0xE3;			//Temperature command with hold master
			i2cdata[1] = 0xE5;			//Humidity command with hold master
			
			HAL_I2C_Master_Transmit(&hi2c1,0x40,&i2cdata[0],1,5);
			HAL_Delay(10);

			for(int i = 0;i<3;i++)
			{
				HAL_I2C_Master_Receive(&hi2c1,0x40,&i2cdata_receive[0],3,10);
				HAL_Delay(10);
			}
			
			HAL_I2C_Master_Transmit(&hi2c1,0x40,&i2cdata[1],1,5);
			HAL_Delay(10);

			for(int i = 0;i<3;i++)
			{
				HAL_I2C_Master_Receive(&hi2c1,0x40,&i2cdata_receive[3],3,10);
				HAL_Delay(10);
			}
			
			
			
			
				
			//Generating CRC of temp from first 2 bytes
			crc_check = generate_crc8(&i2cdata_receive[0],2);
			
			if(i2cdata_receive[2] != crc_check)
			{
				temp_sht31 = 0;	
			}
			
			else
			{
				temp_raw_sht31 = i2cdata_receive[0];
				temp_raw_sht31 <<= 8;
				temp_raw_sht31 = temp_raw_sht31 | i2cdata_receive[1];	
					
				temp_sht31 = temp_raw_sht31;
				temp_sht31 *= 175;
				temp_sht31 /= 0xffff;
				temp_sht31 = -45 + temp_sht31;
			}
			
			//Generating CRC of humi from first 3rd and 4th bytes
			crc_check = generate_crc8(&i2cdata_receive[3],2);
			
			if(i2cdata_receive[5] != crc_check)
			{
				humi_sht31 = 0;	
			}			
			
			else
			{
				humi_raw_sht31 = i2cdata_receive[3];
				humi_raw_sht31 <<= 8;
				humi_raw_sht31 = humi_raw_sht31 | i2cdata_receive[4];	
			
				humi_sht31 = humi_raw_sht31;
				humi_sht31 *= 100;
				humi_sht31 /= 0xFFFF;
			}
	}

	else
	{
		temp_sht31 = 0;
		humi_sht31 = 0;
	}
}





